import ol from '../../ol_extend'
import util from './util'
const RipperUtil = function (options) {
    this.map = options.map;
    this.olMap = this.map.olMap;
    this._cache = [];
    this.picBase64 = [];
    this.vectorLayer_ = null;
    this.addImg();
    this.loadCache();
};

RipperUtil.prototype._add = function (feature, layer, timer) {
    this._cache.push({
        feature: feature,
        layer: layer,
        timer: timer
    });
};

RipperUtil.prototype._remove = function (feature) {
    let index = -1;
    for (let i = 0, len = this._cache.length; i < len; i++) {
        let f = this._cache[i];
        if (f.feature === feature) {
            index = i;
            break;
        }
    }
    if (index !== -1) {
        let dataArray = this._cache.splice(index, 1);
        this.olMap.removeLayer(dataArray[0].layer);
        window.clearInterval(dataArray[0].timer);
    }
};

RipperUtil.prototype._contain = function (feature) {
    let ret = false;
    for (let i = 0, len = this._cache.length; i < len; i++) {
        let f = this._cache[i];
        if (f.feature === feature) {
            ret = true;
            break;
        }
    }
    return ret;
};

RipperUtil.prototype.addFeature = function (coord, i, size) {
    let f = new ol.Feature(new ol.geom.Point(coord));
    f.setStyle(new ol.style.Style({
        image: new ol.style.Icon({
            scale: 1,
            anchor: [0.5, 0.5],
            size: size,
            src: this.picBase64[i]
        })
    }));
    f.setProperties({
        _type: 'ripper'
    });
    return f;
};


RipperUtil.prototype.start = function (feature, vectorLayer) {
    if (feature.get('_type') === 'ripper' || this._contain(feature)) {
        return;
    }
    this.clear();
    if(vectorLayer){
        this.vectorLayer_ = vectorLayer;
        this.addListen_();
    }
    let layer = new ol.layer.Vector({
        source: new ol.source.Vector({
            wrapX: false
        }),
        zIndex: 0
    });
    layer.setProperties({
        _type: 'ripper'
    });
    this.olMap.addLayer(layer);
    let coord = feature.getGeometry().getLastCoordinate();
    layer.getSource().addFeature(this.addFeature(coord, 0));
    let index = 1;
    let timer = setInterval(function () {
        layer.getSource().clear();
        layer.getSource().addFeature(this.addFeature(coord, index));
        index++;
        index = index % 8;
    }.bind(this), 200);
    this._add(feature, layer, timer);
};

RipperUtil.prototype.startArray = function (itemDatas, vectorLayer) {
    let self = this;
    if (itemDatas.length === 0) {
        return;
    }

    let featureArray = [];
    itemDatas.forEach(function (item) {
        let f = util.getFeatureFromPoint(item.longitude, item.latitude, util.EPSG4326Obj, self.olMap.getView().getProjection());
        if (f) {
            featureArray.push(f);
        }
    });
    this.clear();
    if(vectorLayer){
        this.vectorLayer_ = vectorLayer;
        this.addListen_();
    }
    let layer = new ol.layer.Vector({
        source: new ol.source.Vector({
            wrapX: false
        }),
        zIndex: 0
    });
    layer.setProperties({
        _type: 'ripper'
    });
    this.olMap.addLayer(layer);
    let tempFeatures = [];
    featureArray.forEach(function (feature) {
        tempFeatures.push(self.addFeature(feature.getGeometry().getLastCoordinate(), 0));
    });
    layer.getSource().addFeatures(tempFeatures);
    let index = 1;
    let timer = setInterval(function () {
        tempFeatures = [];
        featureArray.forEach(function (f) {
            tempFeatures.push(self.addFeature(f.getGeometry().getLastCoordinate(), index));
        });
        layer.getSource().clear();
        layer.getSource().addFeatures(tempFeatures);
        index++;
        index = index % 8;
    }.bind(this), 200);
    this._add(featureArray[0], layer, timer);
};

RipperUtil.prototype.clear = function () {
    let self = this;
    this.vectorLayer_ = null;
    this.removeListen_();
    this._cache.forEach(function (item) {
        self._remove(item.feature);
    })
};

RipperUtil.prototype.loadCache = function () {
    let layer = new ol.layer.Vector({
        source: new ol.source.Vector({
            wrapX: false
        }),
        zIndex: 0
    });
    layer.setProperties({
        _type: 'ripper'
    });
    this.olMap.addLayer(layer);
    for (let i = 0; i < 11; i++) {
        layer.getSource().addFeature(this.addFeature(this.olMap.getView().getCenter(), i, [1, 1]));
    }
    window.setTimeout(function () {
        layer.getSource().clear();
        this.olMap.removeLayer(layer);
    }.bind(this), 1000);
};

RipperUtil.prototype.addListen_ = function () {
  ol.events.listen(this.olMap, 'clearVectorLayer', this.ListenFun_, this);
};


RipperUtil.prototype.removeListen_ = function () {
    let self = this;
  ol.events.unlisten(this.olMap, 'clearVectorLayer', this.ListenFun_, this);
};

RipperUtil.prototype.ListenFun_ = function (params) {
    if (this.vectorLayer_ && params.layer === this.vectorLayer_) {
        this.clear();
    }
};

RipperUtil.prototype.clearByVectorLayer = function(layer){
  if (this.vectorLayer_ && layer === this.vectorLayer_) {
    this.clear();
  }
};

